from selenium import webdriverfrom selenium.webdriver.common.keys import Keysfrom selenium.webdriver.common.by import Bysearch_field_locator = "sb_form_q"driver = webdriver.Chrome()driver.get('https://www.bing.com')search_field = driver.find_element(By.CLASS_NAME, search_field_locator)search_field.clear()search_field.send_keys("Barcelona")search_field.send_keys(Keys.ENTER)